import React from "react";
import { useState } from "react"
import './bottomNavigation.css';
import "@fontsource/red-hat-display";
import logo from './logo.svg';
import hamburger from './hamburger.svg';

import './min.css'
function BottomNavigation(){

    return(
        <div className="bottomNav">
            <div className="row">
                <div className="box" style={{'max-width':'240px','background-color':'none','box-shadow':'none'}}><div style={{'display':'flex','flex-direction':'row',}}><img src={logo} style={{width:'100%'}} /><p className="service-specific-text">Governance</p></div><p>Our vision is to help every digital dream come alive through a better and sustain security</p></div>
                <div className="box" style={{'max-width':'240px','background-color':'none','box-shadow':'none','padding':'10px'}}>
                    <h3 className="service-specific-text" style={{'text-align':'left'}}>Products</h3>
                    <a href="test.html">Product 1</a>
                    <a href="test.html">Product 2</a>
                    <a href="test.html">Product 3</a>

                </div>

                <div className="box" style={{'max-width':'240px','background-color':'none','box-shadow':'none'}}><div style={{'display':'flex','flex-direction':'row',}}><img src={logo} style={{width:'100%'}} /><p className="service-specific-text">Governance</p></div><p>Our vision is to help every digital dream come alive through a better and sustain security</p></div>
                <div className="box" style={{'max-width':'240px','background-color':'none','box-shadow':'none'}}><div style={{'display':'flex','flex-direction':'row',}}><img src={logo} style={{width:'100%'}} /><p className="service-specific-text">Governance</p></div><p>Our vision is to help every digital dream come alive through a better and sustain security</p></div>

            </div>
        </div>
    );
}
/* Confederacie. */




export default BottomNavigation;
